    year: '2012',
    duration: 85,
    description:
      'Глубокий и личный портрет известного фотографа и режиссера, работы которого всегда сочетали в себе его любовь к фотографии и музыке одновременно. Антон Корбейн сделал себе имя прежде всего как автор черно-белых портретов таких людей, как Боно, Клинт Иствуд, Майлс Дэвис, Rolling Stones, Бьорк и многих других. Его работы не только появлялись на обложках знаковых музыкальных альбомов и модных журналов последних двадцати лет, но и сформировали художественный вкус целого поколения, выросшего на этих самых пластинках и журналах. Однако в силу своего характера и профессии Корбейн всегда оставался за кадром, непроницаемым для посторонних взглядов, в фильме же режиссер распутывает его личную историю и следует по пятам за своим героем. Так, зритель становится его попутчиком в поезде, выслушивает шутки Боно о том, что в кадре Корбейна он всегда выглядит лучше, чем на самом деле, оказывается свидетелем съемок с Джорджем Клуни, кухонных разговоров с матерью и семейных обедов, предваряемых молитвами (отец Корбейна был священником).',
