    id: 28,
    nameRU: 'Бабушка Lo-Fi ',
    nameEN: 'Amma Lo-Fi',
    director: 'Ингибьёрг Биргисдоуттир, Орри Йоунссон, Кристин Бьёрк Кристьянсдоуттир',
    country: 'Исландия, Дания',
    year: '2011',
    duration: 65,
    description:
      'Невероятная история скандинавской пенсионерки Сигридур Нильсдоуттир, которая начала сочинять музыку в возрасте 70 лет, играя в своей гостиной на простенькой электронной клавиатуре и обычных бытовых и кухонных предметах. Таким необычным образом она записала 59 альбомов за семь лет и обрела в Исландии по-настоящему иконический статус, вдохновив своим подходом к творчеству многих исландских музыкантов (в том числе именитых múm и Sigur Ros), и все они теперь отдают ей дань уважения, исполняя в фильме театрализованные номера под ее музыку. Режиссеры фильма — дебютанты в кино, но гении от музыки и визуального искусства: в фильме съемки на 16-миллиметровую пленку комбинируются с изобретательной анимацией, достойной Музея современного искусства в Нью-Йорке, где этот фильм и демонстрировался наряду с множеством других международных фестивалей.',
