    year: '2013',
    duration: 82,
    description:
      'Один из ключевых процессов прошлого десятилетия глазами подсудимых\n\nПоловина действия фильма происходит в суде. На судебной скамье — три основателя крупнейшего в мире торрент-трекера The Pirate Bay, защищающие ценность свободы информации. Фильм — документальное свидетельство изменившегося мира, в котором, с одной стороны, хостинг трекеру предоставляет Пиратская партия Швеции, реальная политическая сила с готовой программой по реформации законодательства в области копирайта и двумя местами в Европарламенте, с другой стороны, в этом мире за нелегальное распространение информации и услуги в его посредничестве можно получить уже совсем не виртуальный тюремный срок — что и происходит с главными героями фильма. Ультрасовременная документалистика во всех смыслах: фильм, выпущенный по свободной лицензии Creative Commons, открывал в этом году документальную часть престижной внеконкурсной программы Panorama на Берлинале — и одновременно с мировой премьерой был выложен в торренты от имени самого режиссера, который отдавал последние указания по телефону в момент, когда вышел на сцену представлять кино.\n',
