    id: 43,
    nameRU: ' Джо Страммер: Будущее неизвестно',
    nameEN: 'Joe Strummer: The Future Is Unwritten',
    director: 'Джульен Темпл',
    country: 'Ирландия, Великобритания',
    year: '2007',
    duration: 124,
    description:
      'Сначала его звали Джон Грэм Меллор, он родился в Анкаре, учился в престижной частной школе и увлекался музыкой. Затем он взял себе имя Джо Страммер, услышал впервые в жизни Sex Pistols и стал фронтменом The Clash; британской культуре после этого не бывать прежней. Снимать портрет Страммера было на роду написано Джулиену Темплу, главному хроникеру английской рок-сцены. Но даже ему понадобилось определенное время, чтобы осознать масштабы оставшейся после внезапной смерти музыканта зияющей дыры. Чтобы рассказать о Страммере, режиссер проделал колоссальную работу: он взял для фильма более полусотни интервью с самыми разными людьми — в диапазоне от Боно и Бобби Гиллеспи до Мартина Скорсезе и Джонни Деппа. Такой разброс собеседников лишь подчеркивает, насколько глубокий след оставил Страммер в памяти других людей; он был одним из последних, кто не зависел от времени, но сам его определял.',
