    id: 44,
    nameRU: 'Жизнь Кидда',
    nameEN: 'Kidd Life',
    director: 'Андреас Йонсен',
    country: 'Дания',
    year: '2012',
    duration: 97,
    description:
      'Датский подросток Николас Вествуд взял себе сценическое имя Кидд, положил на YouTube записанную с друзьями песню и стал самым популярным на родине рэпером, видео которого собирают миллионы просмотров, а записи возглавляют топ продаж на iTunes. Андреас Йонсен запечатлел историю взлета и падения, очень характерную для мира веб 2.0, когда популярность и слава приходят и уходят самым причудливым образом (см. об этом одну из глав «Римских приключений» Вуди Аллена). Поклонником 22-летнего музыканта стал даже датский премьер-министр, мечтавший об автографе; но «Жизнь Кидда» рассказывает и об оборотной стороне внезапных побед: режиссер с диким драйвом и практически романным размахом запечатлевает новый мир возможностей, искушений и испытаний, который открылся перед новой звездой.',
