    id: 46,
    nameRU: ' Пити & Джинджер',
    nameEN: 'Petey & Ginger',
    director: 'Ada Bligaard Søby',
    country: 'Дания, США',
    year: '2012',
    duration: 60,
    description:
      'Пити играет на гитаре в гаражной группе Thee Oh Sees и работает на складе порнографии, упаковывая и рассылая по всем миру секс-игрушки и видео для взрослых. Джинджер в ночную смену в нью-йоркском баре предсказывает счастливое будущее людям, особенно пострадавшим от обвала экономики в 2008-м. Они оба выросли на американской идеологии всеобщего счастья и благополучия и оба столкнулись с миром разрушенных надежд, невыполненных социальных обещаний и тяжелого финансового кризиса. «Пити & Джинджер» — это взрослая сказка о двух аутсайдерах, заблудившихся в своем поиске простого человеческого счастья. Это фильм о мире, в котором только музыка и дружба помогают человеку остаться на плаву.',
