    id: 54,
    nameRU: ' Супер-пупер Элис Купер',
    nameEN: 'Super Duper Alice Cooper',
    director: 'Сэм Данн, Реджинальд Харкема, Скот МакФадьен',
    country: 'Канада',
    year: '2014',
    duration: 98,
    description:
      'Пятнадцатилетний сын проповедника, вдохновившись The Beatles и The Yardbirds, в начале 60-х основывает собственную рок-группу. Сменив несколько названий, группа наконец остановится на Alice Cooper. Через несколько лет на Alice Cooper обратят внимание — они прослывут городским посмешищем, и рок-критики будут поносить их пластинки изо всех сил. Никто даже и представить не сможет, что по прошествии пятидесяти лет про Alice Cooper будет знать весь мир — связывая, впрочем, это название уже не с группой, но с ее лидером, тем самым сыном проповедника. Продюсеры фильма «Iron Maiden Flight 666» решили не выжимать интересные реплики из говорящих голов и сделали склейку из архивных фотографий и съемок, сопроводив их лишь закадровыми голосами. Сага о взлетах и падениях главного в истории шок-рокера получилась ни капельки не страшной — зато исключительно красочной и подробной, многогранной и единственной в своем роде — как и ее главный герой.',
    trailerLink: 'https://www.youtube.com/watch?v=m_OXmxbNS5M',
