    nameRU: 'Еще',
    nameEN: 'Yet',
    director: 'Дмитрий Лавриненко',
    country: 'Россия',
    year: '2014',
    duration: 96,
    description:
      'О великой русской группе «АукцЫон», недавно отпраздновавшей свое тридцатилетие, написали очень-очень много букв и сняли несколько безыскусных телевизионных документалок. С фильмом «Еще» все совершенно по-другому: режиссер Дмитрий Лавриненко работал над ним аж семь лет — ровно столько понадобилось, чтобы поймать своевольное изящество, до сих пор хранимое Федоровым, Гаркушей, Озерским и компанией. Стоит заглянуть за мощный музыкальный фасад, как за ним обнаруживается не история группы, но хроники путешествия, целью которого оказывается ни на что не похожая, удивительная музыка. В «Еще» ухвачены как процесс сочинения песен, которые сейчас поют наизусть, так и то, что обычно остается за скобками: фрагменты быта, гастрольные дневники, разговоры, во время которых произносится ключевое: «Нельзя много смотреть на свободу, иначе закружится голова».',
