    id: 64,
    nameRU: 'Повинуйся художнику',
    nameEN: 'Obey the Artist',
    director: 'Онди Тимонер',
    country: 'США',
    year: '2014',
    duration: 14,
    description:
      'Шепард Фэйри до сих пор верит в американскую мечту. Говорит, она сделала его тем, кто он есть, — то есть одним из самых влиятельных стрит-арт-художников современности. И что в некотором смысле это даже хорошо, что у него не было меценатов, которые готовы были платить ему просто за его творчество. Что он до сих пор все рисует собственными руками, но технологии помогают ему делать более масштабные проекты; что по дороге на открытие собственной выставки в Музее современного искусства в Бостоне несколько лет назад он был арестован восемью полицейскими за то, что приклеил стикер на стену. Шепард Фэйри рассказывает свои правила жизни, в то время как режиссер дает нам возможность подсмотреть за его работой и жизнью, главы которой стремительно сменяют друг друга. Вот мы в его студии, а вот в индейской резервации; вот он с баллонами в руках у гигантской стены, а вот в арт-галерее на вечеринке по случаю открытия его выставки «Sid: Superman is Dead», посвященной его кумиру Сиду Вишесу. В микрофон орут Билли Айдол, Клэм Берке из Blondie, Стив Джонс из Sex Pistols и Ли Горман из Wow wow wow, которых он собственноручно собрал по этому случаю, а сам Шепард, одетый как всегда в футболку не то с Марком Боланом, не то с группой Damaged, стоит и улыбается своей широкой, обезоруживающей улыбкой, тем самым доказывая, что он, в отличие от многих, по-прежнему настоящий.\n\n',
    trailerLink: 'https://www.youtube.com/watch?v=-FjDrloVnqo',
