    id: 66,
    nameRU: 'Алан Вега. Миллион мечтаний',
    nameEN: 'Alan Vega, Just a Million Dreams',
    director: 'Мари Лозье',
    country: 'Франция',
    year: '2014',
    duration: 16,
    description:
      'Нью-йоркский художник и музыкант, зачинщик панк-музыки, основатель группы Suicide, повлиявшей на все и вся, настоящая глыба движения «никакой волны» — количество эпитетов, уместных по отношению к Алану Веге, можно длить практически до бесконечности, и все они будут уместны, но лучше всего рассказывает о себе он сам. Этим беззастенчиво пользуется Мари Лозье, художница и режиссер, снимавшая Пичиз, Пи-Орриджа, Гай Мэддина и еще массу занятных персонажей. В ее фильме, снятом, как и все остальные работы Мари на 16-миллиметровую камеру, Алан Вега хохочет, смотря ситком «Все любят Реймонда», разговаривает с сыном об Элвисе, гримасничает, танцует — в резульате чего из этих осколков реальности получается самое настоящее кино: гипнотически-завораживающее, живое, бунтарское и неизменно смешное, как и сам Алан Вега. К тому же кино, как нельзя лучшее подходящее к его наэлектризованной, пульсирующей музыке; не оторваться.',
