    duration: 90,
    description:
      'Что Канье Уэст ценит дороже денег? Зачем Tommy Hilfiger раздавал пацанам из Бронкса вещи из новых коллекций? Как рэперы и мелкие гангстеры заставили мир выучить словосочетание «уличная мода»? «На стиле» документирует живую историю романа моды и хип-хопа, рассказывая, как родившаяся на злых улицах культура завоевала мир. В разговоре о золотых цепях, шляпах Kangol и белых кроссовках, а также бандах, расизме и бедности черных районов на протяжении нескольких эпох режиссер и музыкальный журналист Саша Дженкинс использует архивные видео с ТВ и анимацию, а также собственные интервью с историками моды и музыкантами — от легендарного редактора Vogue Андре Леона Телли до Фаррелла Уильямса в мехах. Получилось высказывание не столько о музыке или моде, сколько о корнях, хрониках и эволюции культуры в целом. Одним из продюсеров фильма выступил известный рэпер Нэс.',
