    description:
      'Одновременно его видеодневник и ретроколлаж непредсказуемого, хаотичного, искрящегося заразительной энергией города, который очень редко спал и которого больше нет и не будет. Худющий Бликса Баргельд, Ник Кейв, Тильда Суинтон и многие другие; тусовки, клубы и драки, панк, авангард и техно; вещества, беспредел и еще не разрушенная стена, за которой царит вечное уныние — обо всем этом со слов участников глазами инсайдера. Звук, картинка, герои — все сделано так достоверно, что кажется, будто Берлин 80-х уже за окном.\n\n',
