    id: 69,
    nameRU: 'Sume — Звук революции',
    nameEN: 'Sumé: Mumisitsinerup nipaa',
    director: ' Инук Силис Хег',
    country: 'Гренландия, Дания, Норвегия',
    year: '2014',
    duration: 92,
    description:
      'Фильм  о первой гренландской рок-группе\n\nВ 1973 году четыре гренландских студента вдали от дома, в метрополии Дании, сколотили софт-рок-группу Sumé и в качестве акта неповиновения начали петь протестные политические песни на родном языке. Через шесть лет их родная волшебная страна наконец получила широкую автономию. Съемки на «супер-8», Дания и гренландский Нуук, разговоры с фанатами, друзьями и сочувствующими общественными деятелями — это будто бы типичный фильм о типичной рок-группе, повлиявшей, однако, на жизнь целого государства. «Sumé — The Sound of a Revolution» — фильм о том, как даже небольшие попытки неравнодушной амбициозной молодежи изменить мир могут дать реальный результат. Кто бы мог подумать, что волосатые неагрессивные рокеры станут ролевой моделью для многих поколений музыкантов Греландии благодаря тому, что решат спеть «Как единая страна мы вновь оживем» на родном языке.',
