    id: 70,
    nameRU: 'Здорово и вечно',
    nameEN: 'Machine translate: Healthy and forever',
    director: 'Анна Цирлина, Наталья Чумакова',
    country: 'Россия',
    year: '2014',
    duration: 75,
    description:
      'Фильм «Здорово и вечно» — это первый и единственный фильм, посвященный ранним годам группы «Гражданская оборона», режиссерский дебют Натальи Чумаковой, бас-гитаристки группы и вдовы Егора Летова, и Анны Цирлиной. В основу фильма легли уникальные съемки, сделанные участниками группы, интервью с людьми, принимавшими активное участие в судьбе «Обороны» на начальном этапе, редкие архивные кадры. Режиссеры фильма сделали почти невозможное — собрали внятный и ослепительно живой рассказ о том, как Игорь Летов стал Егором Летовым, фиксирующий происходившее с ним и его кругом с начала 80-х по начало 90-х. «Здорово и вечно» — это не документальный байопик в строгом смысле слова, но скорее успешная попытка поймать мятежный дух времени и людей, которые ломали это время под себя.',
