    id: 75,
    nameRU: 'Орион',
    nameEN: 'Orion: The Man Who Would Be King',
    director: 'Джини Финлэй',
    country: 'Великобритания, США',
    year: '2015',
    duration: 88,
    description:
      'Джимми Эллис с детства предпочитал карьеру музыканта конюшне в родной Алабаме, но с 1964 года был толком никому не нужен — пока король и бог рок-н-ролла на горе всей Америке скончался в 1977-м, что послужило причиной как взлета, так и падения Эллиса, известного как Орион. Благодаря маске и тембру голоса Орион-Эллис и Элвис были удивительно похожи; Ориона подписали на тот же лейбл, что и Элвиса, — Sun Records, и слушатели полюбили думать, что Пресли на самом деле до сих пор жив. Фильм о Орионе сняла профессиональный шотландский документалист Джинни Финлэй, автор нескольких документалок, в числе которых «Великого хип-хоп надувательства». Финлэй купила пластинку Ориона за фунт барахолке и, мягко говоря, удивилась сходству двух музыкантов, после чего несколько лет уделила истории человека со славой призрака, поговорив с его близкими, которым он был очень дорог.',
