    id: 80,
    nameRU: 'От станции к станции',
    nameEN: 'Station to Station',
    director: 'Даг Эйткен',
    country: 'США',
    year: '2015',
    duration: 71,
    description:
      'Бродячий оркестр из музыкантов, художников, архитекторов, фотографов и танцоров едет на поезде из Нью-Йорка в Окленд.\n\n24 дня, 10 остановок, два океана- один железнодорожный путь калифорниец Дуг Айткен превратил в 61 мини-фильм. В каждом из них заснят как поезд, очень красиво светящийся светодиодами, так и непосредственный момент создания того или иного произведения, будь то концерт Бека с госпельным хором, рисующая машина Олафура Элиассона или негромко поющий Эриэл Пинк в колготках. Все они кратко рассказывают, что думают о путешествиях, жизни, индустрии и вообще своей работе, попутно описывая собственные творческие методы.\n\nЗритель выступает то как собеседник этих грандиозных личностей, то как пассажир, который смотрит на Америку из окна, то как сторонний наблюдатель этой конструкции, несущейся куда-то прямо в вечность.',
