    nameRU: 'Берроуз',
    nameEN: 'Burroughs: The Movie',
    director: 'Ховард Брукнер',
    country: 'США',
    year: '1983',
    duration: 86,
    description:
      'Первый и единственный длинный документальный фильм о великом контркультурном писателе, который с большим удовольствием становится под прицел видеокамеры. Режиссер Говард Брукнер начал работать над «Burroughs» в 1978-м как над выпускной работой из Нью-Йоркского университета. Закончил в 1983-м, проведя много времени и с самим Берроузом, и с его друзьями и последователями. В кадре появляются Аллен Гинзберг и Патти Смит, оператор — Том Дичилло, звук вообще записан товарищем Брукнера по имени Джим Джармуш. Брукнер умер в 1989-м — к столетию со дня рождения Берроуза, в 2014-м, всего несколько раз показанный фильм был доделан и перевыпущен племянником режиссера. От США до Северной Африки, от чтения отрывков из «Голого завтрака» до воспоминаний о мололодости, от бесценных монологов до живого и порой очень смешного общения героя с другими людьми — обо всем этом с бесконечной демонической привлекательностью.',
