      'Герою фильма двадцать три года, и он обычный мечтатель. Работает продавцом в гипермаркете, живёт в коммуналке с рабочими мигрантами, попутно грезя о карьере музыканта. Никто не воспринимает его музыкальные устремления всерьёз: ни родственники, ни лучший друг, ни соседи. В особенности они… Но у героя есть старая «Ямаха», которая, по его мнению, должна привести к желанной мечте.',
