    director: 'Ламин Даниель Ядама, Ларс Ловен, Йеран Ульссон',
    country: 'Unknown',
    year: '2016',
    duration: 87,
    description:
      'Фильм о современной клубной сцене почти дюжины больших африканских столиц: Йоханнесбурга, Лагоса, Дакара — озвучен певицей Нене Черри и начинен фрагментами текстов и выступлений Фела Кути, одного из самых влиятельных африканских артистов и политических активистов. Его яркие и местами радикальные высказывания о борьбе с неоколониализмом, о том, что слово «демократия» не так уж далеко от «сумасшествия» (democrazy) соседствуют с не менее впечатляющими образами молодых африканских музыкантов, тех, кто готовит в домашних условиях африканскую танцевальную революцию.',
