    id: 94,
    nameRU: ' Мы – X',
    nameEN: 'We Are X',
    director: 'Стивен Кайак',
    country: 'США, Великобритания',
    year: '2016',
    duration: 93,
    description:
      '«Постоянно спрашивая: «Почему я здесь?» Что я делаю в этом мире?», я будто бы ищу причину для смерти. Вот почему я играю на барабанах так, будто никакого завтра не существует», — говорит в начале фильма Ёсики Хаяси, со-основатель одной из главных рок-групп Японии, X Japan.\n\nX Japan, в соответствии с названием, очень японская группа — в фильме рассказывается о чести, достоинстве, попытках выйти на западный рынок и том, что в любые моменты жизни ты должен быть готов к тому, чтобы выполнить волю императора. Все критики наперебой хвалят группу, ненадолго появляющиеся Стэн Ли, Джин Симмонс и Мэрилин Мэнсон склоняют голову в почтении, фанаты без ума от них, но на самом деле это фильм не об успехе и о том, как достичь в жизни всего, что хотел. «We Are X» лишь поначалу показывает только подготовку к важному для группы концерту в Madison Square Garden. Ёсики рассказывает о смерти отца и не стесняется показывать свои походы по врачам, лишь иногда отказываясь говорить о слишком личном. Тоси, вокалист и давний друг Ёсики, откровенно отвечает на вопросы о времени, проведённом в секте, и о временах, когда ему пришлось уйти из группы. Остальные участники скорее остаются на заднем плане — но лишь для того, чтобы подчеркнуть эту историю многолетней дружбы, пережившей смерть близких, срывы, непонимание и ссоры.',
